import './App.css';

import React,{Component} from 'react';
//import data from './user/users_job.js';
import data from './user/users.js';



class Table extends Component{
  constructor(props){ 
    super(props);

    this.myUserList = data;
  };

  datas(){
    return (
      <tr> 
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_first_name)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_birth_date)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_gender)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_job_id)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_first_name)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_first_name)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_first_name)}</td>
        </tr>
    )
  }
  render(){
    return (
      <table style={{width:"80%"}}>

        <tr style={{color:"black",fontSize:"15px"}}>
          <th>Nomes</th>
          <th>Data de Nascimento</th>
          <th>Genero</th>
          <th>Info</th>
          <th>Titulo</th>
          <th>Endere√ßo</th>
          <th>Salario</th>
        </tr>
        {this.datas()}

      </table>
    )
  };

}


export default Table;
